,'2016-03-17 22:57:32'),('1436','<div>\r\n<p>Die Zeiten in denen Mädchen noch so richtig brav waren sind vorbei. Die Zeiten von Kernseife auch. Heute leistet die Washlotion DIRTY GIRL auf rein pflanzlicher Basis, angereichert mit Plankton und Aloe gute Dienste nach dem Ausflug ins Nachtleben.</p>\r\n<div>\r\n<p></p>\r\n<div>Inhalt: 250 ml</div>\r\n&nbsp;\r\n<div><span style=\"color: #666666;\"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href=\"http://www.desaster.com/\" style=\"color: #666666;\">www.desaster.com</a> erwerben.</span> <br>\r\n</div>\r\n</div></div>','<div><br>\r\n</div>','','','','','','','zeiten,denen,mädchen,richtig,brav,vorbei,zeiten','','','','','','','','2016-03-17 22:57:32'),('1477','<div>\r\n<p>Champagnerverschluss GOLF </p>\r\n<div>\r\n<p></p>\r\n<div>Wenn du bereits einen Golfball unter dem Kopfkissen liegen hast, dann wird dich sicher auch unser Champagnerverschluss GOLF erfreuen. Er arbeitet zuverlässig nach dem \'Silberlöffelprinzip\' und ist richtig massiv gebaut.Abmessungen: 11 * 4 cm</div>\r\n&nbsp;\r\n<div><span style=\"color: #666666;\"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href=\"http://www.desaster.com/\" style=\"color: #666666;\">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n</div></div>','<br>','','','','','','','champagnerverschluss,golf,bereits,golfball,unter,kopfkissen','','','','','','','','2016-03-17 22:57:32'),('1487','<div>\r\n<p>In zeitlos klassischem Design und aus edlem Holz gefertigt. Hier überleben die mühsam gesammelten Geburtstagstermine deiner Freunde auch die nächsten fünfzig Pocket-PC Generationen und Computerabstürze. Der HAPPY B wird mit Pergamentröllchen und einem Hochzeitspin geliefert!</p>\r\n<p>Abmessungen: 48 * 37 * 2 cm</p>\r\n<p>Gewicht: 1300 g</p>\r\n<p>Material: Buchenschichtholz</p>\r\n<div>\r\n<p></p>\r\n<div>Design: Alexander Schnell-Waltenberger</div>\r\n&nbsp;\r\n<div><span style=\"color: #666666;\"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href=\"http://www.desaster.com/\" style=\"color: #666666;\">www.desaster.com</a> erwerben.</span>&nbsp;  <br>\r\n</div>\r\n</div></div>','<div><br>\r\n</div>','','','','','','','zeitlos,klassischem,design,edlem,holz,gefertigt,hier,überleben','','','','','','','','2016-03-17 22:57:32'),('1651','<div>\r\n<p>Da kann das Bier aus dem Getränkemarkt in Zukunft nicht mehr mithalten. Dein edles Gebräu Marke \"Do it yourself\" ist ein riesen Partyspaß und schmeckt sogar richtig gut! Das Set PROSIT enthält alles was Du zur Herstellung von ca. 25 Litern naturtrübem Bier benötigst. Die mitgelieferte Brauanleitung beschreibt wie es funktioniert und enthält Rezepte für unterschiedliche Biersorten. Keine Vorkenntnisse notwendig. Einfach loslegen und Dein eigener Braumeister werden.</p>\r\n<p>Lieferumfang:</p>\r\n<p>10 l Gärbehälter mit Deckel</p>\r\n<p>Zapfhahn</p>\r\n<p>alle Zutaten für 25 l Bier</p>\r\n<div>\r\n<p></p>\r\n<div>Rezeptsammlung</div>\r\n&nbsp;\r\n<div><span style=\"color: #666666;\"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href=\"http://www.desaster.com/\" style=\"color: #666666;\">www.desaster.com</a> erwerben.</span>&nbsp; <br>\r\n</div>\r\n</div></div>','<br>','','','','','','','bier,getränkemarkt,zukunft,mehr,mithalten,edles','','','','','','','','2016-03-17 22:57:32'),('1661','<div>\r\n<p></p>\r\n<div>Wenn man es sich recht überlegt, dann steht die Schürze BAVARIA auch Männern gar nicht schlecht!</div>\r\n&nbsp;\r\n<div><span style=\"color: #666666;\"><strong>Bezugshinweis:</strong> bei Interesse können Sie dieses Produkt bei <a href=\"http://www.desaster.com/\" style=\"color: #666666;\">www.desaster.com</a> erwerben.</span>&nbsp; <br>\r\n</div>\r\n</div>','<div>\r\n<p><br>\r\n </p></div>','','','','','','','recht,überlegt,dann,steht,schürze,bavaria,männern','','','','','','','','2016-03-17 22:57:32'),('1661-01','','','','','','','','','','','','','','