g</a>\r\nmeiner E-Mail-Adresse zur Abwicklung des Käuferschutzes durch Trusted Shops bin ich einverstanden. <a href=\"http://www.trustedshops.com/shop/protection_conditions.php?shop_id=[{$oView->getTSExcellenceId()}]\" target=\"_blank\">Bedingungen</a> für den Käuferschutz.</p>','Trusted shops protection text','<p>The Trusted Shops buyer protection secures your online purchase. I agree with the transfer and <a href=\"http://www.trustedshops.com/shop/data_privacy.php?shop_id=[{$oView->getTSExcellenceId()}]\" target=\"_blank\">saving</a>\r\nof my e-mail address for the buyer protection handling by Trusted Shops. <a href=\"http://www.trustedshops.com/shop/protection_conditions.php?shop_id=[{$oView->getTSExcellenceId()}]\" target=\"_blank\">Conditions</a> for the buyer protection.</p>',0,'','',0,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','','','2013-04-11 06:25:27'),('c4241316b2e5c1966.96997011','oxhelpalist',1,1,0,1,1,'','Hilfe - Die Produktliste','<p>Hier können zusätzliche Informationen, weiterführende Links, Bedienungshinweise etc. für die Hilfe-Funktion in den <em>Produktlisten</em> eingefügt werden. </p>','Help - Product List','<p>Here, you can insert additional information, further links, user manual etc. for the &quot;Help&quot;-function on <em>product pages</em>.</p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2011-03-18 13:25:11'),('c4241316b2e5c1966.96997012','oxhelpdefault',1,1,0,1,1,'','Hilfe - Main','<p>Hier können zusätzliche Informationen, weiterführende Links, Bedienungshinweise etc. für die Hilfe-Funktion in der <em>Kategorieansicht</em> eingefügt werden. </p>','Help - Main','<p>Here, you can insert additional information, further links, user manual etc. for the &quot;Help&quot;-function on <em>category pages</em>.</p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2011-03-18 13:24:01'),('c4241316b2e5c1966.96997013','oxhelpstart',1,1,0,1,1,'','Hilfe - Die Startseite','<p>Hier können zusätzliche Informationen, weiterführende Links, Bedienungshinweise etc. für die Hilfe-Funktion auf der <em>Startseite</em> eingefügt werden. </p>\r\n<p>&nbsp;</p>','Help - Start page','<p>Here, you can insert additional information, further links, user manual etc. for the &quot;Help&quot;-function on the <em>start page</em>.</p><br />',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2011-03-18 13:23:12'),('c4241316b2e5c1966.96997015','oxstartwelcome',1,1,0,1,1,'','start.tpl Begrüßungstext','<h1><strong>Willkommen</strong> [{ if $oxcmp_user }]<strong>[{ $oxcmp_user->oxuser__oxfname->value }] [{ $oxcmp_user->oxuser__oxlname->value }] </strong>[{else}] [{/if}][{ if !$oxcmp_user }]<strong>im OXID <span style=\"color: #ff3301\">e</span>Shop 5</strong>[{/if}]</h1>\r\nDies ist eine Demo-Installation des <strong>OXID eShop 5</strong>. Also keine Sorge, wenn Sie bestellen: Die Ware wird weder ausgeliefert, noch in Rechnung gestellt. Die gezeigten Produkte (und Preise) dienen nur zur Veranschaulichung der umfangreichen Funktionalität des Systems.\r\n<div><strong>&nbsp;</strong></div>\r\n<div><strong>Wir wünschen viel Spaß beim Testen!</strong></div>\r\n<div><strong>Ihr OXID eSales Team</strong></div>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Hinweis für den Shop Administrator:</strong></p>\r\n<p>Dieser Text kann im Admin-Bereich unter dem Menüpunkt <em>Kundeninformation -&gt; CMS-Seiten -&gt; start.tpl Begrüßungstext</em><strong> </strong>bearbeitet werden.<strong><br />\r\n</strong></p>\r\n<p><strong>&nbsp;</strong></p>','start.tpl welcome text','<h1><strong>Welcome</strong> [{ if $oxcmp_user }]<strong>[{ $oxcmp_user->oxuser__oxfname->value }] [{ $oxcmp_user->oxuser__oxlname->value }] </strong>[{else}] [{/if}][{ if !$oxcmp_user }]<strong>to OXID <span style=\"color: #fc6634\">e</span>Shop 5</strong>[{/if}]</h1>\r\n<p>This is a demo installation of <strong>OXID eShop 5</strong>. Don\'t worry when ordering: The goods will not be delivered nor charged. The displayed products and prices are solely tended to show the comprehensive functionality of the shopping cart system.</p>\r\n<div><strong>Have fun testing!</strong></div>\r\n<div><strong>Your OXID eSales team</strong></div>\r\n<p>&nbsp; </p>\r\n<p><strong>Notice for the shop administrator:</strong></p>\r\n<p>Update this text in the admin area. Choose from admin menu: <em>Customer Info -&gt; CMS Pages -&gt; start.tpl welcome text</em></p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2011-03-18 10:54:59'),('c4241316c6e7b9503.93160420','oxbargain',1,1,0,1,1,'','Angebot der Woche','<table>[{foreach from=$oView->getBargainArticleList() item=articlebargain_item}] <tbody><tr><td>\r\n<div class=\"product_image_s_container\"><a href=\"[{$articlebargain_item->getLink()}]\"><img border=\"0\" alt=\"[{ $articlebargain_item->oxarticles__oxtitle->value }][{if $articlebargain_item->oxarticles__oxvarselect->value }] [{ $articlebargain_item->oxarticles__oxvarselect->value }][{/if}] [{$oxcmp_shop->oxshops__oxtitlesuffix->value}]\" src=\"[{ $articlebargain_item->getDynImageDir()}]/[{$articlebargain_item->oxarticles__oxicon->value}]\"></a></div> </td><td class=\"boxrightproduct-td\"> <a href=\"[{$articlebargain_item->getLink()}]\" class=\"boxrightproduct-td\"><strong>[{ $articlebargain_item->oxarticles__oxtitle->value|cat:\"\r\n\"|cat:$articlebargain_item->oxarticles__oxvarselect->value|strip_tags|smartwordwrap:15:\"<br>\r\n\":2:1:\"...\" }]</strong></a><br>\r\n [{ if $articlebargain_item->isBuyable() }] <a href=\"[{$articlebargain_item->getToBasketLink()}]&amp;am=1\" class=\"details\" onclick=\"showBasketWnd();\" rel=\"nofollow\"><img border=\"0\" src=\"[{$oViewConf->getImageUrl(\'arrow_details.gif\')}]\" alt=\"\"> Jetzt bestellen! </a> [{/if}] </td></tr>[{/foreach}]\r\n</tbody></table>','Week\'s Special','<table>[{foreach from=$oView->getBargainArticleList() item=articlebargain_item}] <tbody><tr><td>\r\n<div class=\"product_image_s_container\"><a href=\"[{$articlebargain_item->getLink()}]\"><img border=\"0\" src=\"[{ $articlebargain_item->getDynImageDir()}]/[{$articlebargain_item->oxarticles__oxicon->value}]\" alt=\"[{ $articlebargain_item->oxarticles__oxtitle->value }][{if $articlebargain_item->oxarticles__oxvarselect->value }] [{ $articlebargain_item->oxarticles__oxvarselect->value }][{/if}] [{$oxcmp_shop->oxshops__oxtitlesuffix->value}]\"></a></div> </td><td class=\"boxrightproduct-td\"> <a class=\"boxrightproduct-td\" href=\"[{$articlebargain_item->getLink()}]\"><strong>[{ $articlebargain_item->oxarticles__oxtitle->value|cat:\"\r\n\"|cat:$articlebargain_item->oxarticles__oxvarselect->value|strip_tags|smartwordwrap:15:\"<br>\r\n \":2:1:\"...\" }]</strong></a><br>\r\n [{ if $articlebargain_item->isBuyable()}] <a onclick=\"showBasketWnd();\" class=\"details\" href=\"[{$articlebargain_item->getToBasketLink()}]&amp;am=1\" rel=\"nofollow\"><img border=\"0\" alt=\"\" src=\"[{$oViewConf->getImageUrl(\'arrow_details.gif\')}]\"> Order now! </a> [{/if}] </td></tr>[{/foreach}] </tbody></table>',1,'','',1,0,0,0,0,'','','','','','','','','','','oxrootid','CMSFOLDER_PRODUCTINFO','','0000-00-00 00:00:00'),('c8d45408c08bbaf79.09887022','oxuserordernpemail',1,1,0,1,1,'','Ihre Bestellung (Fremdländer)','<div>Vielen Dank für Ihre Bestellung!</div>\r\n<p><strong><span style=\"color: #ff0000\">Hinweis:</span></strong> Derzeit ist uns keine Versandmethode für dieses Land bekannt. Wir werden versuchen, Versandmethoden zu finden und Sie über das Ergebnis unter Angabe der Versandkosten informieren. </p>Bei Fragen sind wir jederzeit für Sie da: Schreiben Sie einfach an [{ $shop->oxshops__oxorderemail->value }]! <br />\r\n<br />','your order (other country)','<p>Thank you for your order!</p>\r\n<p><strong><span style=\"color: #ff0000\">Information:</span></strong> Currently, there is no shipping method defined for your country. We will find a method to deliver the goods you purchased and will inform you as soon as possible.</p>\r\n<p>If you have any requests, don\'t hesitate to contact us! [{ $shop->oxshops__oxorderemail->value }]</p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2011-03-18 11:00:23'),('c8d45408c4998f421.15746968','oxadminordernpemail',1,1,0,1,1,'','Ihre Bestellung Admin (Fremdländer)','<div>\r\n<p> <span style=\"color: #ff0000;\"><strong>Hinweis:</strong></span> Derzeit ist keine Liefermethode für dieses Land bekannt. Bitte Liefermöglichkeiten suchen und den Besteller unter Angabe der <strong>Lieferkosten</strong> informieren!\r\n&nbsp;</p> </div>\r\n<div>Folgende Artikel wurden soeben unter [{ $shop->oxshops__oxname->value }] bestellt:<br>\r\n<br>\r\n</div>','your order admin (other country)','<p> <span style=\"color: #ff0000\"><strong>Information:</strong></span> Currently, there is no shipping method defined for this country. Please find a delivery option and inform the customer about the <strong>shipping costs</strong>.</p>\r\n<p>The following products have been ordered on [{ $shop->oxshops__oxname->value }]:<br />\r\n<br /></p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2011-03-18 09:34:35'),('c8d45408c5c39ea22.75925645','oxuserordernpplainemail',1,1,0,1,1,'','Ihre Bestellung (Fremdländer) Plain','Vielen Dank für Ihre Bestellung!\r\n\r\nHinweis: Derzeit ist uns keine Versandmethode für dieses Land bekannt. Wir werden versuchen, Versandmethoden zu finden und Sie über das Ergebnis unter Angabe der Versandkosten informieren.\r\n\r\nBei Fragen sind wir jederzeit für Sie da: Schreiben Sie einfach an [{ $shop->oxshops__oxorderemail->value }]!','your order plain (other country)','Thank you for your order!\r\nInformation: Currently, there is no shipping method defined for your country. We will find a method to deliver the goods you purchased and will inform you as soon as possible.\r\n\r\nIf you have any requests don\'t hesitate to contact us! [{ $shop->oxshops__oxorderemail->value }]',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2011-03-18 11:01:08'),('c8d45408c718782f3.21298666','oxadminordernpplainemail',1,1,0,1,1,'','Ihre Bestellung Admin (Fremdländer) Plain','Hinweis: Derzeit ist keine Liefermethode für dieses Land bekannt. Bitte Liefermöglichkeiten suchen und den Besteller informieren!\r\n\r\nFolgende Artikel wurden soeben unter [{ $shop->oxshops__oxname->getRawValue() }] bestellt:','your order admin plain (other country)','<p>Information: Currently, there is no shipping method defined for this country. Please find a delivery option and inform the customer about the shipping costs.\r\n\r\nThe following products have been ordered on [{ $shop->oxshops__oxname->getRawValue() }]:</p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_EMAILS','','2011-03-18 09:35:41'),('ce77743c334edf92b0cab924a7','oxstartmetakeywords',1,1,0,1,1,'','META Keywords Startseite','kite, kites, kiteboarding, kiteboards, wakeboarding, wakeboards, boards, strand, sommer, wassersport, mode, fashion, style, shirts, jeans, accessoires, angebote','META keywords start page','kite, kites, kiteboarding, kiteboards, wakeboarding, wakeboards, boards, beach, summer, watersports, funsports, fashion, style, shirts, jeans, accessories, special offers',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','','','2011-03-18 10:41:33'),('ce79015b6f6f07612270975889','oxstartmetadescription',1,1,0,1,1,'','META Description Startseite','Alles zum Thema Wassersport, Sportbekleidung und Mode. Umfangreiches Produktsortiment mit den neusten Trendprodukten. Blitzschneller Versand.<br />','META description start page','<p>All about watersports, sportswear and fashion. Extensive product range including several trendy products. Fast shipping.</p>\r\n<p>&nbsp;</p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','','','2011-03-18 10:40:41'),('d0f7ac8b29909908dc20d854224944fe','oxnopaymentmethod',1,1,0,1,1,'','No payment method text','<p>Derzeit ist keine Versandart für dieses Land\r\ndefiniert.</p>\r\n<p>Wir werden versuchen, Liefermöglichkeiten zu\r\nfinden und Sie über die Versandkosten informieren.</p>','No payment method text','<p>Currently we have no shipping method set up\r\nfor this country.</p>\r\n<p>We are aiming to find a possible delivery\r\nmethod and we will inform you as soon as possible via e-mail about the result,\r\nincluding further information about delivery costs.</p>',0,'','',0,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','','','2013-04-10 10:07:03'),('d74fdc1ed22a0d469bdcc5f003ca6575','oxregistrationdescription',1,1,0,1,1,'','Registration Description','<p>Mit einem persönlichen Kundenkonto haben Sie folgende Vorteile:<br />\r\n - Verwaltung der Lieferadressen<br />\r\n - Prüfung des Bestellstatus<br />\r\n - Bestellhistorie<br />\r\n - persönlicher Merkzettel<br />\r\n - persönliche Wunschliste<br />\r\n - Newsletter-Verwaltung<br />\r\n - Sonder- und Rabattaktionen</p>','Registration Description','<p>A customer with an account has advantages like:<br />\r\n - Administration of shipping addresses<br />\r\n - Check order status<br />\r\n - Order History<br />\r\n - Personal Wish List<br />\r\n - Personal Gift Registry<br />\r\n - Newsletter subscription<br />\r\n - Special offers and discounts</p>',0,'','',0,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','','','2013-04-10 09:53:55'),('f240baaafdf6930a88771197df2116c3','oxtscodmessage',1,1,0,1,1,'','Trusted shops cash on delivery message','Zzgl. 2,- EUR für die Geldübermittlung, die der Zusteller vor Ort erhebt','Trusted shops cash on delivery message','Plus 2,- EUR for money transfer that will be collected on site by messenger',0,'','',0,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','','','2013-07-19 10:05:14'),('f41427a07519469f1.34718981','oxdeliveryinfo',1,1,0,1,1,'','Zahlung und Lieferung','<p>Fügen Sie hier Ihre Versandinformationen- und kosten ein.</p>','Shipping and Charges','<p>Add your shipping information and costs here.</p>',1,'','',1,0,0,0,0,'','','','','','','','','','','8a142c3e4143562a5.46426637','CMSFOLDER_USERINFO','','0000-00-00 00:00:00'),('f41427a099a603773.44301043','oxsecurityinfo',1,1,0,1,1,'','Datenschutz','Fügen Sie hier Ihre Datenschutzbestimmungen ein.','Privacy Policy','Enter your privacy policy here.',1,'','',1,0,0,0,0,'','','','','','','','','','','8a142c3e4143562a5.46426637','CMSFOLDER_USERINFO','','0000-00-00 00:00:00'),('f41427a10afab8641.52768563','oxnewstlerinfo',1,1,0,1,1,'','Neuigkeiten bei uns','<div>Mit dem [{ $oxcmp_shop->oxshops__oxname->value }]-Newsletter alle paar Wochen. <br>\r\nMit Tipps, Infos, Aktionen ... <br>\r\n<br>\r\nDas Abo kann jederzeit durch Austragen der E-Mail-Adresse beendet werden. <br>\r\nEine <span class=\"newsletter_title\">Weitergabe Ihrer Daten an Dritte lehnen wir ab</span>. <br>\r\n<br>\r\nSie bekommen zur Bestätigung nach dem Abonnement eine E-Mail - so stellen wir sicher, dass kein Unbefugter Sie in unseren Newsletter eintragen kann (sog. \"Double Opt-In\").<br>\r\n<br>\r\n</div>','newsletter info','<p>Stay in touch with the periodic [{ $oxcmp_shop->oxshops__oxname->value }]-newsletter every couple of weeks. We gladly inform you about recent tips, promotions and new products.</p>\r\n<p>You can unsubscribe any time from the newsletter.</p>\r\n<p>We strictly refuse <span class=\"newsletter_title\">transferring your data to 3rd parties</span>.</p>\r\n<p>For subscription we use the so called &quot;double opt-in&quot; procedure to guarantee that no unauthorized person will register with your e-mail address.</p>',1,'','',1,0,0,0,0,'','','','','','','','','','','30e44ab83fdee7564.23264141','CMSFOLDER_USERINFO','','2011-03-18 09:48:49');
